import React, { Component } from "react";

class Search extends Component {
  constructor(props) {
    super(props);
    this.state = {
      result: [],
      isLoading: true,
    };
  }
  render() {
    return (
      <div className="search-input">
        <input placeholder="Search" />
        <ul className="result">
          <li>Abc</li>
          <li>Def</li>
          <li>GHI</li>
        </ul>
      </div>
    );
  }
}

export default Search;
